func lengthOfLongestSubstring(s string) int {
	length := 0
	for i := 0; i < len(s)-1; i++ {
		for j := i + 1; j < len(s); j++ {
			if !isUnique(s[i:j]) {
				break
			} else {
				if j-i > length {
					length = j - i
				}
			}
		}
	}
	return length
}

func isUnique(sub string) bool {
	for i := 0; i < len(sub)-1; i++ {
		for j := i + 1; j < len(sub); j++ {
			if sub[i] == sub[j] {
				return false
			}
		}
	}
	return true
}
